// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.9.0;
import "./LoopToken.sol";

contract Products {
    address Admin;
    uint32 count = 0;
    LoopToken public tokenContract;
    struct item {
        uint32 Id;
        address Owner;
        string ProductName;
        string descriptors;
        string Imgurl;
        uint56 Price;
    }
    mapping(address => item) public items;

    constructor(LoopToken _tokenContract) {
        Admin = msg.sender;
        tokenContract = _tokenContract;
    }

    function AddProducts(
        string memory _productName,
        string memory _descriptors,
        string memory _Imgurl,
        uint56 _Price
    ) public {
        require(
            _Price > 0 && _Price <= 200000,
            "price can not big than 200000 or less than one"
        );
        uint32 id = count++;
        items[msg.sender] = item(
            id,
            msg.sender,
            _productName,
            _descriptors,
            _Imgurl,
            _Price
        );
    }
}
